import React, { useState } from "react";
import "./services.css";

const servicesData = [
  {
    title: "Individual Therapy",
    description:
      "One-on-one sessions to help you navigate personal challenges and improve mental well-being.",
    icon: "🧠",
  },
  {
    title: "Couples Therapy",
    description:
      "Sessions designed to enhance communication and resolve conflicts in relationships.",
    icon: "❤️",
  },
  {
    title: "Group Therapy",
    description:
      "Join a supportive group setting to share experiences and gain insights.",
    icon: "👥",
  },
  {
    title: "Child and Adolescent Therapy",
    description:
      "Specialized therapy for young individuals dealing with various emotional challenges.",
    icon: "👶",
  },
  {
    title: "Online Therapy",
    description:
      "Access professional support from the comfort of your home through secure online sessions.",
    icon: "💻",
  },
  {
    title: "Career & Life Coaching",
    description:
      "Guidance and support to help you achieve personal and professional goals.",
    icon: "🎯",
  },
];

const Services = () => {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    name: "",
    mobile: "",
    email: "",
    date: "",
    service: "Individual Therapy",
  });

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Appointment Request Submitted!");
    setShowForm(false);
  };

  return (
    <div className="services-container">
      <h1 className="services-title">Our Services</h1>
      <p className="services-description">
        Explore the range of therapy services we offer to support your mental health journey.
      </p>
      <div className="services-grid">
        {servicesData.map((service, index) => (
          <div
            key={index}
            className="service-card"
            onClick={() => {
              if (service.title === "Individual Therapy") setShowForm(true);
            }}
          >
            <div className="service-icon">{service.icon}</div>
            <h2 className="service-title">{service.title}</h2>
            <p className="service-description">{service.description}</p>
          </div>
        ))}
      </div>

      {/* Popup Form */}
      {showForm && (
        <div className="popup-overlay">
          <div className="popup-form">
            <h2>Book an Appointment</h2>
            <form onSubmit={handleSubmit}>
              <label>Name:</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleInputChange}
                required
              />

              <label>Mobile Number:</label>
              <input
                type="tel"
                name="mobile"
                value={formData.mobile}
                onChange={handleInputChange}
                required
              />

              <label>Email:</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleInputChange}
                required
              />

              <label>Date:</label>
              <input
                type="date"
                name="date"
                value={formData.date}
                onChange={handleInputChange}
                required
              />

              <label>Service:</label>
              <select name="service" value={formData.service} onChange={handleInputChange}>
                <option>Individual Therapy</option>
                <option>Stress Management</option>
                <option>Depression Counseling</option>
                <option>Anxiety Therapy</option>
              </select>

              <button type="submit">Submit</button>
              <button type="button" className="close-btn" onClick={() => setShowForm(false)}>
                Close
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Services;
